import React from "react";
import {
  View,
  Text,
  Image,
  ScrollView,
  StyleSheet,
  Dimensions,
  TouchableOpacity,
} from "react-native";
import { Svg, Path } from "react-native-svg";
import {
  fontPercentage,
  heightPercentage,
  widthPercentage,
} from "./ResponsiveSize";

import { getStatusBarHeight } from "react-native-status-bar-height";

export default function App() {
  return (
    <View style={stylesheet.container}>
      <View style={stylesheet.header}>
        <Text style={stylesheet.headertext}>üçÑdeepmush</Text>
      </View>
      <View style={stylesheet.body}>
        <Text>body</Text>
        <Image
          style={stylesheet._image_1}
          source={{ uri: imageUrl_image_1 }}
        ></Image>
      </View>
      <View style={stylesheet.footer}>
        <Text>footer</Text>

        <TouchableOpacity
          style={[stylesheet.buttonContainer, stylesheet.fabookButton]}
        >
          <View style={stylesheet.socialButtonContent}>
            <Image
              style={stylesheet.icon}
              source={{
                uri: "https://png.icons8.com/facebook/androidL/40/FFFFFF",
              }}
            />
            <Text style={stylesheet.loginText}>Continue with facebook</Text>
          </View>
        </TouchableOpacity>

        <TouchableOpacity
          style={[stylesheet.buttonContainer, stylesheet.googleButton]}
        >
          <View style={stylesheet.socialButtonContent}>
            <Image
              style={stylesheet.icon}
              source={{
                uri: "https://png.icons8.com/google/androidL/40/FFFFFF",
              }}
            />
            <Text style={styles.loginText}>Sign in with google</Text>
          </View>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const stylesheet = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "yellow",
  },

  header: {
    flex: 0.6,
    alignItems: "center",

    backgroundColor: "green",

    marginTop: getStatusBarHeight(),
  },

  headertext: {
    paddingTop: "25%",
  },

  body: {
    flex: 2,
    backgroundColor: "blue",
  },

  footer: {
    flex: 1.4,
    backgroundColor: "red",
  },

  _image_1: {
    position: "absolute",
    width: widthPercentage(390),
    height: heightPercentage(303),
    borderRadius: 0,
    opacity: 1,
    right: "auto",
    top: heightPercentage(50),
    bottom: "auto",
    transform: [{ translateX: 0 }, { translateY: 0 }, { rotate: "0deg" }],
    backgroundColor: "rgba(0,0,0,0)",
  },

  buttonContainer: {
    height: 45,
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    marginBottom: 20,
    width: 250,
    borderRadius: 30,
  },
  loginButton: {
    backgroundColor: "#3498db",
  },
  fabookButton: {
    backgroundColor: "#3b5998",
  },
  googleButton: {
    backgroundColor: "#ff0000",
  },
  loginText: {
    color: "white",
  },
  restoreButtonContainer: {
    width: 250,
    marginBottom: 15,
    alignItems: "flex-end",
  },
  socialButtonContent: {
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
  },
  socialIcon: {
    color: "#FFFFFF",
    marginRight: 5,
  },
});

const imageUrl_image_1 =
  "https://sizze-figma-plugin-images-upload.s3.us-east-2.amazonaws.com/fe45c1fbd6a959d2d502bf5e016fd5c7";
